JHF email Oct 18/16:  &quot;With regard to your Help Desk issue .. The &quot;setcmdflags&quot; utility was created by one of our in-house Niagara developers to address requests from multiple customers who wanted to harmonize the menu options available to users throughout an entire station.   Your requirement, the need to specify *different* menu options depending on whether a point resides on the BACnet network or N2 network, therefore represents an enhancement request for this utility.   I will consult with the developer to see whether he might be able to modify this utility to address your requirement (and whether he might be able to do this in a timely fashion).

In the meantime, I will investigate the option of maybe using the Program Editor to selectively change these menu options.

If you are really stuck to get this done, you can hide/unhide command menu options from the slot sheet on a per-point basis.&quot;
